package ABC_Collagex;public class Student {    protected int studid;    protected   String name;    protected int deptID;    public Student(){        studid=1;        name="a";        deptID=2;    }    public Student(int studid,String name,int deptID){        this.studid=studid;        this.name=name;        this.deptID=deptID;    }    public int getDeptID() {        return deptID;    }    public void setDeptID(int deptID) {        this.deptID = deptID;    }    public void setName(String name) {        this.name = name;    }    public String getName() {        return name;    }    public void setStudid(int studid) {        this.studid = studid;    }    public int getStudid() {        return studid;    }    @Override    public String toString() {        return " Student Name "+name+" Student ID "+studid+" Department ID "+deptID;    }}